        <title>Developing IFrame Port</title>
        <style>
            body{
                font-family: Arial, Helvetica, sans-serif;
                text-align:center;
                background-color:black;
                color: white;
                padding: 18px;
            }
            h1{
                font-size: 2.5rem;
                margin-bottom: 20px;
            }
            .gal-container{
                display: grid;
                grid-template-columns: repeat(2,1fr);
                gap:20px;
                padding: 20px;
                max-width: 1550px;
                margin:0;
            }
            .iframe-container{
                width: 100%;
                height:auto;
                border:5px,solid #fff;
            }
            .iframe{
                width:100%;
                height: 100%;
                border: none;
            }
            @media(max-width:760px){
                .gal-container{
                    grid-template-columns: repeat(2,1fr);
                }
            }
        </style>
    </head>
